import React, { Component } from 'react';
import Bootstrap, {
    Navbar,
  } from 'bootstrap-4-react';

const AppBar = () => {
    const Menu = props => (
        <Navbar class="navBar"  dark fixed="dow" bg="dark">
          <Navbar.Brand href="#">Wdemy</Navbar.Brand>
          <Navbar.Toggler
            target="#navbarCollapse"
            aria-controls="navbarCollapse"
            aria-expanded="false"
            aria-label="Toggle navigation"
          />
        </Navbar>
      )
    return (
        <>
           <div>
               <Menu />
           </div>
        </>
    )
}

export default AppBar
